import React from 'react';
import './index.css';
import { Table, Button } from 'antd';
import { DeleteOutlined, EditOutlined } from '@ant-design/icons';

function TabelaHortalicas({dataSource,acoes}) {

    const columns = [
        {
            title: 'Codigo',
            dataIndex: 'key',
            key:'key',
            defaultSortOrder: 'descend',
            sorter: (a, b) => a.key - b.key,

        },
        {
            title: 'Nome',
            dataIndex: 'nome',
            key:'nome'
        },
        {
            title: 'Categoria',
            dataIndex: 'categoria',
            key:'categoria'
        },
        {
            title: 'Classificação',
            dataIndex: 'classificacao',
            key:'classificacao'

        },
        {
            title: 'Valor',
            dataIndex: 'valor',
            key:'valor'
        },
        {
            title: 'Ações',
            dataIndex: 'acoes',
            key:'acoes',
            render: _ => (
                <span>
                    <Button
                        type='primary'
                        style={{ marginLeft: '2px' }}
                        icon={<EditOutlined />}
                        onClick={alert(a.key)}
                    />
                    <Button
                        type='primary'
                        style={{ marginLeft: '2px' }}
                        danger
                        icon={<DeleteOutlined />}
                    />
                </span>
            )
        },
    ];

    return (
        <Table dataSource={dataSource} columns={columns} className='Tabela'/>
    );
}

export default TabelaHortalicas;
